APP_ID}\"\n    cp \"${GOOGLESERVICE_INFO_MEA}\" \"${PLIST_DESTINATION}\"\nelse\n    echo \"-> Using ${GOOGLESERVICE_INFO_APPSTORE}\"\n    echo \"-> Config ${APP_ID}\"\n    cp \"${GOOGLESERVICE_INFO_APPSTORE}\" \"${PLIST_DESTINATION}\"\nfi\n";
		};
